import React, {useEffect, useState} from 'react'
import './MeetingTime.css'

//startTime used for styling (not actually needed since timer keeps going forever)
const MeetingTime = (props: {visible:boolean ,callbackFromParent3(visible: boolean): void; }) => {
    const [isVisible, setIsVisible] = useState<boolean>(props.visible);
    const toggleVisible = () => {
        setIsVisible(false);
    }
    const someFn = () => {
        props.callbackFromParent3(isVisible);
    }
    useEffect(() => {
        someFn()
    },)
    return (
        <div className="popup" style = {{display: !isVisible? 'none':''}}> Meeting Length:
        <button className = "xOut" onClick = {toggleVisible}>x</button>
        </div>
    )
}


export default MeetingTime;
